=======

In his enchanting debut feature, Jacques Tati stars as a fussbudget of a
postman who is thrown for a loop when a traveling fair comes to his village.

Even in this early work, Tati was brilliantly toying with the devices (silent
visual gags, minimal yet deftly deployed sound effects) and exploring the
theme (the absurdity of our increasing reliance on technology) that would
define his cinema.

